(11991, 27, 1, 5993, '&lt;p&gt;Ce questionnaire évaluera la sensation de fatigue que vous pourriez éprouver. Pour chaque question veuillez ne sélectionner qu’une seul réponse, celui qui vous semble décrire le mieux votre état actuel. Essayez de répondre en fonction de vos premières impressions, sans trop réfléchir à chaque question.&lt;/p&gt;', 0, '', '2020-08-25 13:50:24', 'MACFARIA', '2020-08-25 21:50:24', 'MACFARIA'),
