(19807, 27, 1, 9360, '&lt;p&gt;La reconstruction mammaire est unique à tout(e)s les patient(e)s. En tant que chirurgien(ne)s plasticien(ne)s, il est important que nous comprenions ce que vous ressentez lors du traitement de votre cancer du sein et de votre reconstruction mammaire.&lt;/p&gt;&lt;p&gt;Le questionnaire Breast-Q permet aux chirurgien(ne)s plasticien(ne)s de mieux comprendre l’impact de divers types de reconstruction sur votre propre résultat personnel.&lt;/p&gt;&lt;p&gt;En répondant à ce sondage, vous aiderez votre chirurgien(ne) plasticien(ne) à comprendre vos sentiments sur le résultat de votre reconstruction mammaire et nous aiderez à améliorer les soins que nous prodiguons aux patientes atteintes d’un cancer du sein qui poursuivent une reconstruction mammaire.&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-01-25 11:51:05', 'FAMA6017', '2021-01-25 21:51:05', 'FAMA6017'),
(19808, 27, 2, 9360, '&lt;p&gt;Breast reconstruction is unique to all patients.  As plastic surgeons, it is important that we understand how you feel during the treatment of your breast cancer and your breast reconstruction.&lt;/p&gt;&lt;p&gt;The Breast-Q questionnaire allows plastic surgeons to better understand how various types of reconstruction impact your own personal outcome.&lt;/p&gt;&lt;p&gt;By completing this survey, you will help your plastic surgeon understand your feelings about the outcome of your breast reconstruction and help us to improve the care that we deliver to breast cancer patients who pursue breast reconstruction.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-01-25 11:51:05', 'FAMA6017', '2021-01-25 21:51:05', 'FAMA6017'),
